data:
  definition: conducteur dont l'extrémité coupée a été dénudée pour être insérée dans
    une borne
  examples: []
  notes:
  - Un conducteur dont la forme est arrangée pour qu'il soit introduit dans une borne
    ou dont les torons sont tressés pour en consolider l'extrémité est considéré comme
    conducteur non préparé.
